import React, {Component} from 'react';

import { Container, Row, Col } from 'reactstrap';
import Title from '../UI/Title/Title';
import styles from './IntroInter.module.scss';

export default class IntroInter extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className={module.intro}>
        <Title>
          <h2 className={module.intro__title}>Уровни</h2>
        </Title>
      </div>
    )
  }
}
